import React from 'react';
import {Provider} from 'react-redux';
import store from './components/redux/store'
import logo from './logo.svg';
import './App.css';
import CakeComponent from './components/CakeComponent';

function App() {
  return (
    <Provider store={store}>
      <div className="App">
        <CakeComponent />
      </div>
    </Provider>
  );
}

export default App;
